export default function App() {
  <div className="App">
    <Logo />
    <Form />
    <PackingList />
    <Stats />
  </div>

}
function Logo() {
  return <h1>Far Away</h1>

}
function Form() {
  return <div className="add-form">
    <h3>What need for trip</h3>
  </div>

}
function PackingList() {
  return <div className="list">List</div>

}
function Stats() {
  return <footer><em>Have X in items </em></footer>
}
